import ec2import iamimport route53import s3import z0def create():    s3.create_bucket_if_needed()    vpc_id = ec2.create_vpc_if_needed()    subnet_id = ec2.create_subnet_if_needed(vpc_id)    ec2.create_internet_gateway_if_needed(vpc_id)    iam.create_user_if_needed()    instance_id = ec2.create_instance_if_needed(subnet_id)    address = ec2.create_address_if_needed(instance_id)    route53.create_dns_entry_if_needed(address)def delete():    route53.destroy_dns_entry_if_needed()    ec2.destroy_address_if_needed()    ec2.destroy_instance_if_needed()    iam.delete_old_access_keys()    iam.delete_user_if_needed()    ec2.destroy_internet_gateway_if_needed()    ec2.destroy_subnet_if_needed()    ec2.destroy_vpc_if_needed()# calls the method given as parameterglobals()[z0.args.command]()